import React from 'react';
import './Card.css';
import './Form.jsx';

function Card(props) {
  let p1 = "Try it free 7 days then ₹180/mo. thereafter";
  let p2 = "You have successfully subscribed to our plan ✔️";
  return (
    <>
    <div className="holder">
        <p className="para-right">
        {p2}
        </p>
    </div>
    </>
  )
}

export default Card;
